import React from 'react';

function TodoList() {
    return (
        <>
            <div className='todolist shadow-lg col-1 p-4'>
                <form className='bg-dark d-flex'>
                    <input type="text" name="items" className='w-75'  />
                    <button type='submit' className='w-25 '>
                        submit
                    </button>
                </form>
            </div>
        </>
    );
}

export default TodoList;
